            returns (uint[] memory)
        {
            uint _no = no;
            for(uint i = 0 ; i<hrs ; i++) {
                luminosity.push((uint256(keccak256(abi.encodePacked(_no)))%1000));
                _no++;
                emit pop(luminosity[i]);
            }
